export const ADD_LIST = "ADD_LIST";
export const REMOVE_LIST = "REMOVE_LIST";
export const NEXT_MOVIE = "NEXT_MOVIE";


export function addList() {
    return {
        type: ADD_LIST,
    }
}

export function removeList() {
    return {
        type: REMOVE_LIST,
    }
}

export function nextMovie() {
    return {
        type: NEXT_MOVIE,
    }
}
